import React from "react";
import { Link, Outlet } from 'react-router-dom'
// import UseTable from "./hooks/useTable";
import { useNavigate } from 'react-router-dom'
import FormNew from './formNew'
// import axios from 'axios'

export const AddNewRecipe = () => {
    const navigate = useNavigate()
    return (
        <> 
        <button  className="btn btn-primary mt-2" variant="primary" onClick={() => navigate('/AddNewRecipe')}>Add new recipe on your book</button>
        <button  className="btn btn-primary mt-2" variant="primary"><Link to='FindNew' id="linkbt" className="text-decoration-none">Find for new recipes</Link></button><br></br>
        <button  className="btn btn-primary mt-2" variant="primary"><Link to='WriteNew' id="linkbt" className="text-decoration-none">Write your on recipe</Link></button><br></br>
        <Outlet />

            <button className="btn btn-primary mt-2" variant="primary" onClick={() => navigate(-1)}>Go back</button>
        </>
    )
}
